      out.write("<script>\n");
      out.write("\n");
      out.write("\n");
      out.write("\t$(function() {\n");
      out.write("\t\tvar isScrollUp = false;\n");
      out.write("\t\tvar lastScrollTop;\n");
      out.write("\t\tvar unreadCnt = 0;\n");
      out.write("\t\t\n");
      out.write("\t\tvar divChat = document.getElementById('div_chat');\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t\t//채팅방\n");
      out.write("\t\t/* 전송 버튼 클릭 시 */\n");
      out.write("\t\t$('#btn_append_row').on(\n");
      out.write("\t\t\t\t\"click\",\n");
      out.write("\t\t\t\tfunction() {\n");
      out.write("\t\t\t\t\t// 라인 추가\n");
      out.write("\t\t\t\t\t$('#table_chat').append(\n");
      out.write("\t\t\t\t\t\t\t$('<tr>').append(\n");
      out.write("\t\t\t\t\t\t\t\t\t$('<td>').append($('#add_name').val()),\n");
      out.write("\t\t\t\t\t\t\t\t\t$('<td>').append($('#add_msg').val())));\n");
      out.write("\n");
      out.write("\t\t\t\t\tif (isScrollUp) {\n");
      out.write("\t\t\t\t\t\t// 메뉴가 보이는 상태에서 새로운 라인 추가 시 안 읽은 수 표시\n");
      out.write("\t\t\t\t\t\tunreadCnt++;\n");
      out.write("\t\t\t\t\t\t$('#btn_scroll_down').html('↓ ' + unreadCnt);\n");
      out.write("\t\t\t\t\t}\n");
      out.write("\n");
      out.write("\t\t\t\t\t// 기본적으로 스크롤 최하단으로 이동 (애니메이션 적용)\n");
      out.write("\t\t\t\t\tif (!isScrollUp) {\n");
      out.write("\t\t\t\t\t\t$('#div_chat').animate(\n");
      out.write("\t\t\t\t\t\t\t\t{\n");
      out.write("\t\t\t\t\t\t\t\t\tscrollTop : divChat.scrollHeight\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t- divChat.clientHeight\n");
      out.write("\t\t\t\t\t\t\t\t}, 100);\n");
      out.write("\t\t\t\t\t}\n");
      out.write("\t\t\t\t});\n");
      out.write("\n");
      out.write("\t\t/* 메뉴 스크롤 ↓ 버튼 클릭 시 */\n");
      out.write("\t\t$('#btn_scroll_down').on('click', function() {\n");
      out.write("\t\t\t// 마지막으로 보고 있었던 (스크롤을 올리기 시작했던) 위치로 이동\n");
      out.write("\t\t\t$('#div_chat').animate({\n");
      out.write("\t\t\t\tscrollTop : lastScrollTop\n");
      out.write("\t\t\t}, 100);\n");
      out.write("\n");
      out.write("\t\t\tif (lastScrollTop == divChat.scrollHeight - divChat.clientHeight) {\n");
      out.write("\t\t\t\t// 마지막 위치와 스크롤 최하단이 같다면 (새로 추가된 라인이 없다면) 메뉴 숨김\n");
      out.write("\t\t\t\t$(\"#menu_scroll_down\").css(\"top\", \"200px\");\n");
      out.write("\t\t\t\tisScrollUp = false;\n");
      out.write("\t\t\t\tunreadCnt = 0;\n");
      out.write("\t\t\t\t$('#btn_scroll_down').html('↓');\n");
      out.write("\t\t\t} else {\n");
      out.write("\t\t\t\t// 마지막 위치와 스크롤 최하단이 다르다면 (새로 추가된 라인이 있다면) 마지막 위치를 최하단으로 변경\n");
      out.write("\t\t\t\tlastScrollTop = divChat.scrollHeight - divChat.clientHeight;\n");
      out.write("\t\t\t}\n");
      out.write("\t\t})\n");
      out.write("\n");
      out.write("\t\t/* 스크롤 이벤트 */\n");
      out.write("\t\t$(\"#div_chat\").on(\n");
      out.write("\t\t\t\t'mousewheel DOMMouseScroll',\n");
      out.write("\t\t\t\tfunction(e) {\n");
      out.write("\t\t\t\t\tvar E = e.originalEvent, delta = E.wheelDelta || -E.detail;\n");
      out.write("\n");
      out.write("\t\t\t\t\t// 메뉴를 숨겼을 때만 마지막 위치 저장\n");
      out.write("\t\t\t\t\tif (!isScrollUp) {\n");
      out.write("\t\t\t\t\t\tlastScrollTop = $(this).scrollTop();\n");
      out.write("\t\t\t\t\t}\n");
      out.write("\n");
      out.write("\t\t\t\t\t// 스크롤이 생겼을 때\n");
      out.write("\t\t\t\t\tif ($(this).scrollTop() > 0) {\n");
      out.write("\t\t\t\t\t\tif (delta < 0) {\n");
      out.write("\t\t\t\t\t\t\t// 스크롤 내리는 이벤트 중 최하단 도달 시 메뉴 숨김 (-1은 오차 제어)\n");
      out.write("\t\t\t\t\t\t\tif ($(this).scrollTop() > divChat.scrollHeight\n");
      out.write("\t\t\t\t\t\t\t\t\t- divChat.clientHeight - 1) {\n");
      out.write("\t\t\t\t\t\t\t\t$(\"#menu_scroll_down\").css(\"top\", \"200px\");\n");
      out.write("\t\t\t\t\t\t\t\tisScrollUp = false;\n");
      out.write("\t\t\t\t\t\t\t\tunreadCnt = 0;\n");
      out.write("\t\t\t\t\t\t\t\t$('#btn_scroll_down').html('↓');\n");
      out.write("\t\t\t\t\t\t\t}\n");
      out.write("\t\t\t\t\t\t} else {\n");
      out.write("\t\t\t\t\t\t\t// 스크롤 올리는 이벤트 발생 시 메뉴 보임\n");
      out.write("\t\t\t\t\t\t\t$(\"#menu_scroll_down\").css(\"top\", \"150px\");\n");
      out.write("\t\t\t\t\t\t\tisScrollUp = true;\n");
      out.write("\t\t\t\t\t\t}\n");
      out.write("\t\t\t\t\t}\n");
      out.write("\t\t\t\t});\n");
      out.write("\t});\n");
      out.write("\t\n");
      out.write("\t\n");
      out.write("\t\n");
      out.write("\t\n");
      out.write("////////////////////////////////////////문영준 메신저 기능 시작 지점 ////////////////////////////////////////\t\n");
      out.write("\n");
      out.write("\t// JS 최상위 주소 구하기\n");
      out.write("\tfunction getContextPath() {\n");
      out.write("\t\tvar hostIndex = location.href.indexOf( location.host ) + location.host.length;\n");
      out.write("\t\treturn location.href.substring( hostIndex, location.href.indexOf('/', hostIndex + 1) );\n");
      out.write("\t};\n");
      out.write("\t\n");
      out.write("\t$(document).ready(function(){\n");
      out.write("\t\t$(\"#profileRoot\").val( getContextPath() );\n");
      out.write("\t});\n");
      out.write("\t\n");
      out.write("\t\n");
      out.write("\n");
      out.write("\n");
      out.write("\n");
      out.write("\t/* 친구 요청 목록 조회 함수 */\n");
      out.write(" \tfunction friendRequest(){\n");
      out.write("\t\t$.ajax({\n");
      out.write("\t\t\turl : \"friendRequest\",\n");
      out.write("\t\t\ttype : \"POST\",\n");
      out.write("\t\t\tdata : {},\n");
      out.write("\t\t\tdatatype : \"json\",\n");
      out.write("\t\t\tsuccess : function(result){\n");
      out.write("\t\t\t\tvar $friendReq = $(\"#friendReq\");\n");
      out.write("\t\t\t\tvar $friendRequestArea = $(\"#friendRequestArea\");\n");
      out.write("\t\t\t\tvar root = $(\"#profileRoot\").val();\n");
      out.write("\t\t\t\tvar $savePath = root +\"/resources/profileImage/\";\n");
      out.write("\t\t\t\tif(result == ''){\n");
      out.write("\t\t\t\t\t$friendRequestArea.html(\"지금은 친구요청이 없네요.\")\n");
      out.write("\t\t\t\t}else {\n");
      out.write("\t\t\t\t\t$friendRequestArea.html(\"\") // 기존 html 내용 삭제\n");
      out.write("\t\t\t\t\t\n");
      out.write("\t\t\t\t\t$.each(result, function(i){\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t\t\t//memberProfileUrl\n");
      out.write("\t\t\t\t\t\tvar $finalPath = $savePath + result[i].memberProfileUrl;\n");
